import React from 'react';
import '../styles/About.css';

const About = () => {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        I am a highly skilled and versatile developer with extensive experience across multiple technologies and platforms. My expertise includes:<br /><br />

        <strong>Front-End Technologies:</strong> Proficient in JavaScript, React, HTML, and CSS, enabling me to build dynamic and responsive user interfaces.<br /><br />

        <strong>Back-End Technologies:</strong> Experienced with Java, Node.js, Spring Boot, and Python, allowing me to develop robust and scalable server-side applications.<br /><br />

        <strong>DevOps & Cloud Computing:</strong> Skilled in AWS and Docker, with a solid understanding of CI/CD pipelines and containerization for efficient deployment and management.<br /><br />

        <strong>Scripting & Automation:</strong> Competent in Bash scripting for automating tasks and enhancing development workflows.<br /><br />

        <strong>Security:</strong> Knowledgeable in Kali Linux and its tools, with an understanding of cybersecurity principles and practices.<br /><br />

        I bring a comprehensive approach to software development and system engineering, combining technical proficiency with a commitment to delivering high-quality solutions.
      </p>
    </section>
  );
};

export default About;
